import React from "react";

const defaultClassnames =
  "border border-gray-300 bg-gray-300 text-rd rounded-full px-3 text-sm font-bold ";

function Button(props) {
  return <button {...props} className={defaultClassnames + props.className} />;
}

export default Button;
